Content:
MasterChef Türkiye son bölümde masterclass mücadelesi ekranlara geldi. Danilo şef tarafından pizza eğitimi verilen yarışmacılar eğitim sonunda öğrenciklerini uyguladıkları bir yarışta karşılaştı. TV8 ekranlarında yayınlanan son bölümde masterclass'ı kim kazandı öğrenmek isteyenler yoğun şekilde "MasterChef kim kazandı?" şeklindeki soruya cevap arıyor.2 Eylül MasterChef masterclass oyununu kazanan isim ve diğer tüm detaylar şöyle;

2 Eylül 2022 Cuma günü TV8 ekranlarında yayınlanan MasterChef son bölümde Danilo Şef tarafından MasterClass verildi.

Pizza masterclass'ı alan yarışmacılar ardından en iyi pizza'yı hazırlamak amacıyla tezgah başına geçti. Verilen süre sonunda şefler hazırlanan ürünleri tek tek tadarak değerlendirmede bulundu.Yapılan değerlendirmeler sonucunda en başarılı pizza'yı yapan isim Yağız oldu ve ödülü kazandı.
